import "../styles/Home.css"

const BoxContainer = () => {
  return (
    <div className="box-container">
      <div className="box-row">
        {/* Left Side: Image */}
        <div className="box-column left">
          <img src="assets/Hero.png" alt="Example" className="box-image" />
        </div>

        {/* Right Side: Content */}
        <div className="box-column right">
          <h2 className="box-title">The Live Shopping Marketplace</h2>
          <p className="box-text">Shop, sell, and connect around the things you love.</p>
          <button className="box-button">Download WhatNew</button>
        </div>
      </div>
    </div>
  )
}

export default BoxContainer
